import React from 'react';
import UploadSection from './components/UploadSection';
import VideoPlayer from './components/VideoPlayer';
import './App.css';

function App() {
  return (
    <div className="app">
      <div className="sidebar">
        <UploadSection />
      </div>
      <div className="main">
        <VideoPlayer />
      </div>
    </div>
  );
}

export default App;
